package com.example.hackerrank;

import static org.junit.jupiter.api.Assertions.assertEquals;

import java.util.ArrayList;

import org.junit.jupiter.api.Test;

class SherlockValidStringTestCase {
  public String s;
  public String answer;

  SherlockValidStringTestCase(String s, String answer) {
    this.s = s;
    this.answer = answer;
  }
}

public class SherlockValidStringTest {
  @Test
  void isValidTest() {
    ArrayList<SherlockValidStringTestCase> tests = new ArrayList<SherlockValidStringTestCase>();
    tests.add(new SherlockValidStringTestCase("abbccc", "NO"));
    tests.add(new SherlockValidStringTestCase("aabbcd", "NO"));
    tests.add(new SherlockValidStringTestCase("aabbccddeefghi", "NO"));
    tests.add(new SherlockValidStringTestCase("abcdefghhgfedecba", "YES"));
    tests.add(new SherlockValidStringTestCase("abc", "YES"));
    tests.add(new SherlockValidStringTestCase("abcc", "YES"));
    tests.add(new SherlockValidStringTestCase("aaabbcc", "YES"));
    tests.add(new SherlockValidStringTestCase("aabbc", "YES"));
    tests.add(new SherlockValidStringTestCase("a", "YES"));
    tests.add(new SherlockValidStringTestCase(
        "",
        "YES"));
    // Disable this test because complaining text too long
    // tests.add(new SherlockValidStringTestCase(
    // "",
    // "YES"));
    tests.add(new SherlockValidStringTestCase("abcdee", "YES"));

    for (SherlockValidStringTestCase test : tests) {
      assertEquals(test.answer, SherlockValidString.isValid(test.s));
    }
  }

}
